          <img src="/img/logo.jpeg" alt="Blogger Avatar" />
          <div className="about">
            <h4 className="fullname">{`${user.name} ${user.surname}`}</h4>
            <p>
                {user.about}
            </p>
          </div>
        </div>

        <button className="delete-bloger">
          <img src="/img/delete.png" alt="Delete Blogger" />
        </button>
      </div>
      
      // Главный компонент, использующий UserList

    );
  }
  
